// src/admin_components/AdminNavbar.jsx
import React from "react";
import { NavLink } from "react-router-dom";
import "./admin.css";

const AdminNavbar = ({ onLogout }) => {
  return (
    <nav className="admin-navbar">
      <h2 className="admin-title">ðŸ›  Admin Dashboard</h2>
      <ul className="admin-nav-links">
        <li>
          <NavLink to="/admin/users" activeClassName="active">User Management</NavLink>
        </li>
        <li>
          <NavLink to="/admin/courses" activeClassName="active">Course Management</NavLink>
        </li>
        <li>
          <NavLink to="/admin/settings" activeClassName="active">Settings</NavLink>
        </li>
        <li>
          <button className="btn btn-logout" onClick={onLogout}>Logout</button>
        </li>
      </ul>
    </nav>
  );
};

export default AdminNavbar;
